import React from 'react';

const Index = (props) => {
  const { queryParam1, queryParam2 } = props.match.params;

  const handleQuery = () => {
    console.log('QueryParam1:', queryParam1);
    console.log('QueryParam2:', queryParam2);
  };

  return (
    <div>
      <h1>Query Component</h1>
      <p>QueryParam1: {queryParam1}</p>
      <p>QueryParam2: {queryParam2}</p>
      <button onClick={handleQuery}>Execute Query</button>
    </div>
  );
};

export default Index;
